import "./App.css";

function App() {
  fetch("http://localhost:8000/test", {
    headers: {
      "Content-Type": "application/json",
      key: "abcd",
    },
  }).then(console.log("Test Run"));
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
